import './TaskInfo.css'

const TaskInfo = ({data}) => {

	return (
		<div className='TaskInfo'>
		Title: {data.title}<br />
		CreatedAt: {data.createdAt}<br />
		Dir: {data.dir}<br />
		Status: {data.status}
		</div>
	)	
}

export default TaskInfo
